  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Fort Niobrara NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Fort Niobrara NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, a summary of Refuge
  resources, information about the management direction, and strategies for implementation
  and monitoring. Key planning issues include: Texas longhorn cattle, recreation,
  habitat and wildlife management, funding, and public use.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
